import React from 'react'
import { StyleSheet, Text, View, ScrollView } from 'react-native'
import { Container, Content, Icon, Thumbnail, Header, Left, Right, Body } from 'native-base'

export default function Stories({userFollowing}) {
    return (
            <View style={{ height: 100 }}>
                    <View style={{ flex: 1, flexDirection: 'row', justifyContent: 'space-between', alignItems: 'center', paddingHorizontal: 7 }}>
                        <Text style={{ fontWeight: 'bold' }}>Stories</Text>

                        <View style={{ flexDirection: 'row', 'alignItems': 'center' }}>
                                <Icon name="md-play" style={{ fontSize: 14 }}></Icon>
                                <Text style={{ fontWeight: 'bold' }}> Watch All</Text>
                        </View>
                        </View>
                        <View style={{ flex: 3 }}>
                            <ScrollView
                                horizontal={true}
                                showsHorizontalScrollIndicator={false}
                                contentContainerStyle={{
                                    alignItems: 'center',
                                    paddingStart: 5,
                                    paddingEnd: 5
                                }}

                            >
                                <Thumbnail
                                    style={{ marginHorizontal: 5, borderColor: 'pink', borderWidth: 2 }}
                                    source={{uri: "https://cdni0.trtworld.com/w960/h540/q75/76923_USASpaceX_1587156063102.jpeg"}} />
                                <Thumbnail
                                    style={{ marginHorizontal: 5, borderColor: 'pink', borderWidth: 2 }}
                                    source={{uri: "https://observer.com/wp-content/uploads/sites/2/2020/08/GettyImages-1266114896.jpg"}} />
                                <Thumbnail
                                    style={{ marginHorizontal: 5, borderColor: 'pink', borderWidth: 2 }}
                                    source={{uri: "https://media.timeout.com/images/105653190/image.jpg"}} />
                                <Thumbnail
                                    style={{ marginHorizontal: 5, borderColor: 'pink', borderWidth: 2 }}
                                    source={{uri: "https://images.uline.com/is/image/content/dam/images/S/S16500/S-16067.jpg"}} />

                                <Thumbnail
                                    style={{ marginHorizontal: 5, borderColor: 'pink', borderWidth: 2 }}
                                    source={{uri: "https://i.redd.it/llxj2wizw0nx.png"}} />
                                <Thumbnail
                                    style={{ marginHorizontal: 5, borderColor: 'pink', borderWidth: 2 }}
                                    source={{uri: "https://cdn.shopify.com/s/files/1/0417/4537/products/CanadaFlag2-min_2048x.jpg"}} />
                                <Thumbnail
                                    style={{ marginHorizontal: 5, borderColor: 'pink', borderWidth: 2 }}
                                    source={{uri: "https://hips.hearstapps.com/hmg-prod.s3.amazonaws.com/images/tesla-roadster-25-cars-worth-waiting-for-305-1527124394.jpg"}} />

                            </ScrollView>
                        </View>
                    </View>
    )
}

const styles = StyleSheet.create({})
